import { Link } from 'react-router-dom';
import '../styles/NavBar.css';

function NavBar() {
  return (
    <nav className="navbar">
      <h1>AgriChem Database</h1>
      <div className="nav-links">
        <Link to="/">Home</Link>
        <Link to="/search">Search Products</Link>
      </div>
    </nav>
  );
}

export default NavBar;
